//import './App.css';

import 'antd/dist/antd.min.css';
import { Button } from 'antd';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
	return (
		<div>
			<BrowserRouter>
				<Routes>
					<Route path="/" element={<Home />} />
					<Route path="/register" element={<Regi />} />
				</Routes>
			</BrowserRouter>
		</div>
	);
}

export default App;
